def m_sum(m):
    val=0
    for i in range(0, len(m)):
        val+=m[i]
    return val

def m_add(m1, m2):
    if(len(m1)==len(m2)):
        tempArray=[]
        for i in range(0, len(m1)):
            tempArray.append(m1[i]+m2[i])
        return tempArray

def m_sub(m1, m2):
    if(len(m1)==len(m2)):
        tempArray=[]
        for i in range(0, len(m1)):
            tempArray.append(m1[i]-m2[i])
        return tempArray

def m_pow(m1, power):
    tempArray=[]
    for i in range(0, len(m1)):
        tempArray.append(pow(m1[i],power))
    return tempArray

def sigmoid(z):
    return 1/(1+np.exp(-z))

def inverseSigmoid(z):
    return -1*np.log(z/(1-z))

